// src/App.tsx
import React from 'react';
import xclone from './components/xclone';

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to React with TypeScript</h1>
      </header>
      <main>
        <xclone /> 
      </main>
    </div>
  );
}

export default App;
